import Menu from './order';
import Report from './report';

class App extends Component {
  render() {
    return (
      // <div className="App">
          // <Order/>
          <Switch>
              <Route path='/' Component={Menu}/>
              <Route path='/Report' Component={Report}/>
          </Switch>

      // </div>
    );
  }
}

export default App;
